import React from 'react';
import { Link } from 'react-router-dom';
import Banner from './Components/Banner/Banner';
import './App.css'

const Home = () => {
    return (
        <>
            <div>
                <Banner
                    pageTitle={' Abdelbasset BABEKER'}
                    subtitle={'Welcom To my Profile Homepage '}
                />
                <div id='homePage'>
                    <br />
                    <div>
                        <Link to={'/blogs'}>
                            Blogs
                        </Link>
                    </div>
                    <div>

                        <br />
                        <Link to={'/contacts'}>
                            Contacts
                        </Link>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Home;
